import React from 'react'
import Flag from '../image/Flag_of_India.png';
import './DidYouKnow.css';


function DidYouKnow() {
  return (
    <div>
      <div class="didyou">
      <div class="image">
        <img src={Flag}/>
      </div>
      <div class="text">
        <h1>Did You Know</h1>
      </div>
    </div>
    </div>
  )
}

export default DidYouKnow
